import React from "react";
import "./nav.css";
import "./Logo.png";


// function Nav() {
//   return (
//     <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
//           <a className="navbar-header" img="./Logo.png">Logo</a>
//       <a className="navbar-brand" href="/huddle">
//         Huddle
//       </a>
//       <a className="navbar-brand" href="/active">
//         Active
//       </a>
//       <a className="navbar-brand" href="/snap">
//         Snap
//       </a>
//       <a className="navbar-brand" href="/profile">
//         Profile
//       </a>

//     </nav>
//   );
// }

function Nav() {
  return (
    <div className="container">
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <a className="navbar-brand" href="#">Navbar</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarsExample09" aria-controls="navbarsExample09" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarsExample09">
          <ul className="navbar-nav mr-auto">
            <li className="nav-item active">
              <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Link</a>
            </li>
            <li className="nav-item">
              <a className="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
            </li>
            <li className="nav-item dropdown">
              <a className="nav-link dropdown-toggle" href="#" id="dropdown09" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Dropdown</a>
              <div className="dropdown-menu" aria-labelledby="dropdown09">
                <a className="dropdown-item" href="#">Action</a>
                <a className="dropdown-item" href="#">Another action</a>
                <a className="dropdown-item" href="#">Something else here</a>
              </div>
            </li>
          </ul>
        </div>
      </nav>



    </div>
  );


}

export default Nav;
